  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <div className="footer-logo">
            <img src="img/logo.svg" alt="" />            <p>ИП Сребный Артем Николаевич</p>
          
          </div>
          <div className="footer-links">
            <h4>Полезные ссылки</h4>
            <p>ИНН: 231139523059</p>
            <p>ОГРНИП: 321619600006164</p>
            <div className='line'></div>
            <p>Эл. почта поддержки <a href="mailto:support@yoffer.ru">support@yoffer.ru</a></p>

            <div className='line'></div>
            <p><a href="/privacy-policy">Политика конфиденциальности</a></p>
            <p><a href="/terms-of-use">Условия использования</a></p>
           
          </div>
        </div>
        <div className="footer-bottom">
          <p>&copy; 2025 Yoffer. Все права защищены.</p>
        </div>
      </div>
    </footer>

  );
};

export default Footer;
